import axios from 'axios'
const API_URL = require('./api');

class InterestService {

    getInterestList() {
        return axios.get("https://yru0mc1cdb.execute-api.ap-southeast-1.amazonaws.com/user/interests").then((response) => {
            console.log(response);
        }, (error) => {
            console.log(error);
        });
    }
}

export default new InterestService();
